import React from 'react'
import NavigationItems from './NaviationItems/NavigationItems'

const Header = () => {
    const navigationItems={
        0:{active:false , title:"Made By Yogesh"},
        1:{active:true , title:"Global Stats"},
        2:{active:false , title:"Stats By Country"}

    }
    Object.keys(navigationItems).map((key,i)=>{
        for(let nevitem in navigationItems[key])
        {
            console.log(nevitem);
        }
    })
    return (

        
        <div>
       <nav className="navbar navbar-expand-lg navbar-mainbg">
        <a className="navbar-brand navbar-logo" href="#">Navbar</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <i className="fas fa-bars text-white"></i>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav ml-auto">
                <div className="hori-selector"><div className="left"></div><div className="right"></div></div>
                <li className="nav-item">
                    <a className="nav-link" href="javascript:void(0);"><i className="fas fa-tachometer-alt"></i>Made By Yogesh</a>
                </li>
                <NavigationItems active={true} title="Global Stats"/>
                <li className="nav-item">
                    <a className="nav-link" href="javascript:void(0);"><i className="fas fa-tachometer-alt"></i>Countries</a>
                </li>
            </ul>
        </div>
    </nav>
        </div>
    )
}

export default Header
